import React from "react";

const Properties = () => {
  return (
    <div className="container mx-auto px-4 py-6">
      <h1 className="text-2xl font-bold">Our Properties</h1>
      <p>Browse the latest properties available on our platform.</p>
    </div>
  );
};

export default Properties;
